INSERT INTO `news_pub` VALUES ('0351057c-3bc5-4785-b4be-d52967c69951', '元旦不孤单，一起来狂欢', '3', '干货文章', '2018-12-29 21:26:41', 'news_draft', '<p>2018年就要结束了，大家在仔细思索如何找到一个高薪好工作的同时，有没有思考过，如何在2018年的最后一个月火速脱单呢？\n\n</p><p>时光的沙漏缓缓流淌，流走的除了2018年的时光，还有年初我立下的毒誓：“2018年我要找个好工作，也要找个对象！”<br></p><p>一想到过年回家七大姑八大姨的灵魂三问，我就腿软：“现在月薪多少呀？啥时候把对象带回来给我们看看？”</p><p>“领导啥时候给你升职啊？啥时候结婚我们喝你的喜酒？”\n\n</p><p>虽然已经到了2018年的最后一个工作日。</p><p>孤单寂寞冷的你</p><p>就只能坐在办公室看那些情侣无动于衷吗？</p><p>&nbsp;</p><p>不！</p><p>你也可以要成为万人迷</p><p>元旦不孤单，一起来狂欢！</p><p><br></p><p><br></p><p><br></p>', '2e0256f1-83df-4149-8cb3-293b54ecb6a0');
