INSERT INTO `news_pub` VALUES ('14112ef2-c761-47ec-a7ba-a5a908fa0ed3', '教你几招使用的职场防骗指南', '3', '干货文章', '2018-12-29 21:30:01', '2018-12-29 21:30:01', '<p>1、通过互联网搜索信息。</p><p>可以查询的网站有“国家企业信用信息公示系统”：http://www.gsxt.gov.cn/index.html</p><p>想必财务的小伙伴们对此网站并不陌生，此网站可以查询全国所有已注册公司，如果在此网站上根本查询不到，可以判断为“骗子”公司。</p><p><br></p><p>2、仔细辨别目标公司各方面信息</p><p>正规公司一般都有自己的固定电话、专门的邮箱，和求职者多以邮件、电话联系，因此如果某个公司招聘的联系方式仅仅是QQ、微信、私人电话的，没用固定座机联系的就有很大的嫌疑。</p><p>此外，招聘信息中，可以查询本地区类似岗位、如会计、审计、出纳等工作的工资水平。如果出现工作岗位与待遇差距过大，即工作简单、对技能无较高要求但待遇又特别高的情况，也要注意留心。</p><p><br></p><p>3、注意面试的地点及周边情况</p><p>提前查询对方所说的面试地址是在什么位置，如果是在正规写字楼，基本正常。如果是在偏僻的居民小区、城市郊区、当地农民自建的平房，就要格外注意了。如果已经到了目的地，看到这种情况，就要及时逃走。</p><p><br></p><p>4、面试过程中，注意对方询问的问题是否有异常之处</p><p>部分骗子公司在面试的时候，将问题的重心全部放在询问面试者的家庭、社交、婚姻等情况，一番谈话下来，已经全部掌握了求职者的全部个人情况，利用求职者迫切想要找工作、赚钱的心理，轻易诱骗成功。</p><p>正规公司想要招聘的话，首要关心的肯定是求职者财务、会计方面的专业能力，比如是否适合这个岗位、在这个岗位有什么从业经验、有什么职业规划等与工作相关的问题。</p><p><br></p><p>5、凡是涉及钱财的情况，一定要提高警惕</p><p>一些骗子公司会提出超出常规的要求，比如要求以笔试为理由收取费用、收取培训费等，面试地点不在写字楼，反而在酒店、茶楼，甚至主动声称派专车接送。这些超常的要求看似合理合情，实则没有必要，要提高警惕、学会果断拒绝，不要留恋。</p><p><br></p><p>6、最后一点，也是最重要的一点：求职者千万不能急于求成！！！</p><p>财会行业是需要足够经验积累的工作，刚步入财务行业工资可能不尽如人意。</p><p>But，任何行业、任何岗位，没有一定的专业能力和从业经验，想要拿到高薪是不可能的。</p><p>我们都幻想着钱多事少离家近，无奈却一直钱少事多离家远的；</p><p>我们对于简单的事情觉得委屈，复杂的工作又干不了；</p><p>我们只能调整自己的心态，一步一脚印，积累财务、会计、审计方面的专业能力，切忌好高骛远~~</p><p><br></p><p><br></p>', '2892f380-6cb0-4c66-8368-dc1a02a4f6d1');
