INSERT INTO `news_pub` VALUES ('ccd96eb0-5048-450c-a620-797032060342', '爆笑集锦，让你的生活轻松一刻', '3', '开心一刻', '2018-12-29 21:23:42.0', '2018-12-29 21:23:42.0', '<p><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"></p><p><br></p><p>1、 上班错过公交，于是追着车跑，一个骑着电动车的人在公车旁边喊：“加油啊！ ”我心底突然涌上一股暖流，刚想感慨这世界的美好，那人又接着喊道：“师傅快加油，别让后面这逼追上了！<br><br><br><br>2、 半夜睡不着，爬起床来走到客厅抽支烟，发现一只蟑螂，于是跟它聊了很长时间，把我对生活的看法，对上司的不爽，生活的压力，压榨的发泄给它听，烟抽完了，于是我狠狠一脚踩死了它，没办法，它知道的太多了。<br><br><br><br>3、 女儿才上了4天幼儿园就因感冒“辍学”了。虽说学龄很短，可她对幼儿园的感情却很深。一天，女儿说：“妈妈，我要看书！爷爷说了，不看书就考不上大学。万一我考不上大学，将来怎么上幼儿园？<br><br><br><br>4、 我终究没能飙得过那辆宝马，只能眼看着它在夕阳中绝尘而去，不是我的引擎不好，而是我的车链子掉了。<br><br><br><br>5、今天我花了一百五十块钱剪了一个很抽象的头。回寝室后遭到几个室友强力批判！这时候一旁沉默许久的一同学总结说：这发型性价比很高！才花一百五，剪了个二百五的头。”</p>', '5b207da7-c0b5-43b7-a75f-4bc6a8fe7b94');
