INSERT INTO `news_pub` VALUES ('ec1dbd6e-f232-411b-8e4e-3c1192714298', '求职套路深，求职需谨慎', '3', '防骗指导', '2019-04-21 20:53:06', '2019-04-21 20:53:06', '<p>求职切记不可心急。</p><p>可以通过在企查查、天眼查等网站先了解企业信息，及早了解企业风险状态。</p><p>其次，通过简单面试直接邀约入职的多数不可靠。</p>', '3af42582-e5fa-4176-a0e9-7b4cc9bfa503');
INSERT INTO `news_trash` VALUES ('fee3dc59-9bd2-4a78-ad25-cd12c5028585', '为什么从来没有人告诉我该这样跳槽！', '<p>“在同一个公司待多久跳槽最适合”，这是个老生常谈的话题。但是究竟多久跳槽一次才合适，让自己有所成长又不至于太变化无常呢？</p><p><br></p><p><strong>跳槽频率意味着什么？</strong></p><p>无论是HR还是猎头，对应聘者非常看重的一点便是“忠诚度”，因为一个企业不希望辛辛苦苦培养的员工到头来却为别人做了嫁衣。</p><p>据了解，一个人如果在同一个单位工作年限低于2年往往会被看做“不够忠诚”；而不到1年，便被视为“稳定性差”。</p><p>那么是不是年限越长越有价值呢？不尽然！如果一个人在同一个企业工作年限超过了5～8年，且岗位较低薪资平平，这样的人反而没有竞争力。</p><p>在同一个公司同一个岗位上工作3～5年，如果职位没有上升、薪资没有大涨幅，应该考虑内部转岗或者外部跳槽来增值，否则个人的价值和能力不进则退。</p><p><br></p><p><strong>为什么是3～5年？</strong></p><p>不管是同行同岗还是跨行换岗，一个人在进入一个新的工作环境，第一年往往是“打酱油”的熟悉过程；第二年才可能慢慢进入角色，真正融入企业文化，熟悉自己产品的内涵；经过前2年的积累，到了第三年才真正出成绩，当然这也是职位和薪资提高的关键时期。<br></p><p>如果跳槽后进入一个同行同岗的新环境，那么“打酱油”的时间会缩短，但不会少于6个月，基本也是在第三年才能实现职位和待遇的较大提高。而且主管对于员工的期许也多集中在第二、三年。因此，进入一个新环境后的第三年如果做不出较大成绩，哪怕个人不主动请辞，恐怕主管也会坐不住。</p><p><br></p><p>三年也是大多数正规企业第一次签合同的期限，如果被公司认可，那么接下来将会是合同续签。</p><p>如果个人表现很优异，到了第三年没有获得职位的提升（或是因为内部没有空缺职位），请不要在合同到期日贸然选择不续约。毕竟做生不如做熟，继续巩固一下自己的工作业绩，在第四、五年时看是否有提升的机会？</p><p>如果你有幸在第四或者第五年被内部提拔，那么继续在这个岗位上，仍旧以三到五年为限，为自己设定下一个提升目标。</p><p>如果到了第四、五年，成绩突出却没有得到更高的职位或者薪水，那么最明智的选择就是跳槽。因为眼下的环境已经成了瓶颈，而且个人的求胜欲望和上进心处于高点，此时跳槽不仅可以得到更高的职位和待遇，也可以继续延续个人的求胜欲望。</p><p>如果选择混日子或者安于现状，那么你将会面临“生于忧患，死于安乐”的危险时刻，因为缺乏更高的发展空间，将慢慢削弱个人的求胜欲望，时间也将慢慢钝化个人的上进心，一旦这样的日子持续超过2年，一个人的锐气将被磨平，很难重拾当年的雄风。在这样的状态下跳槽，你很难有信心去博得一个更高的职位和薪水。因为企业更喜欢充满激情、充满创造力的头脑，而不是安于现状、不思进取的心。</p><p><br></p><p>在同一个公司同一个职位上一旦错过了3～5年的跳槽黄金期，员工对安逸的需求大于上进求胜的欲望，随着年龄的增大、家庭琐事的负担，人的惰性将越来越束缚内心，最终沦为朝九晚五混日子的上班族。<br></p><p>有的人尽管职位从职员到了主管，又到了经理，但是薪水每年以5~8%的比率增长，超过5年依旧缺乏竞争力。很多人不再敢于去接受新事物，而安于每年5~8%的涨幅。但在跳槽时，HR只会以你当下的薪资为起点，然后增长10~30%，因为你的工作年限越长且待遇较低，对HR而言，说明你的价值也就在这个水平上，不会给你超过50%的薪资增长幅度。</p><p>3～5年，尤其是在第四或者第五年，员工刚刚过了对原单位的新鲜感，呆腻了老环境，这时跳槽到一个新的环境将继续刺激自己的创造思维。员工很难继续吃老本，只能不断学习提高自己进一步巩固个人的能力，于己于企业都是一个双赢的局面。</p>', '3', '2018-12-29 21:32:48.0', 'news_pub', '61a2174b-689f-4de0-b025-23e9918d842d', '干货文章');
