INSERT INTO `t_seeker` VALUES ('15937561672', '温姑娘', '离职-随时到岗', '', '1年以内', '1996-10', 'wenyaxin1996', '572154391@qq.com', '2019-4-27 16:23:52', '1.jpeg', '本科', '我是院系ACM团队核心成员，长期参与团队管理工作，长期自学算法知识，因此最擅长C语言和数据结构，在算法竞技中锻炼出了团队协作能力、逻辑思维能力、自主学习能力、良好的沟通能力和表达能力，我热爱编程，勤劳、刻苦。哈哈', '1');
