INSERT INTO `t_senior` VALUES ('1', '程维', '创始人&CEO', '1', '2012年，程维创办小桔科技并推出出租车手机召车软件滴滴打车。2015年2月，滴滴打车与快的打车战略合并，随后更名为滴滴出行。2016年8月，滴滴出行并购优步中国。经过五年时间发展，程维带领下的滴滴已经成为中国移动互联网领域的领导者，全球最具价值的科技初创企业；也从单一的出租车召车软件发展成为全球领先的一站式移动出行平台。 如今，程维和他的团队一起持续推动创新的前沿，希望将滴滴打造成为全球智能交通技术的引领者和全球最大汽车运营商。滴滴也和许多城市在智能交通和可持续发展项目方面达成了合作。\n2017年，程维被Fortune China评选为“2017中国最具影响力的50位商界领袖”之一。同年，他还获Forbes评选为 “全球变局者”并与滴滴总裁柳青一起登上Time“科技领域最有影响的20人”榜单。', '1', '1.jpeg');
